            "కారణకారి అవయవం: సర్కోస్పోరా కికుచీ (T. మట్సు & టోమోయాసు) గార్డ్నర్. ఈ పాథోజెన్ గింజలు మరియు గాలి ద్వారా వ్యాపిస్తుంది. ఇది ఆకులు, కాండాలు, కాయలు మరియు గింజలను ప్రభావితం చేస్తుంది. ఈ వ్యాధి మధ్య ప్రదేశ్, మహారాష్ట్ర, కర్ణాటక మరియు ఉత్తర - తూర్పు రాష్ట్రాలలో ప్రధానంగా జరుగుతుంది. ఇది 15% నుండి 30% వరకు పంట నష్టాన్ని కలిగిస్తుంది. తేమగల మరియు వేడి వాతావరణం, ప్రత్యేకంగా పుష్పనం నుండి జైవిక పరిపక్వత దశ వరకు, సంక్రమణకు అనుకూలంగా ఉంటుంది. ఫంగస్ 23 నుండి 27°C ఉష్ణోగ్రత శ్రేణిలో అధికంగా బీజాణులను ఉత్పత్తి చేస్తుంది. పంట కోతకు 15 రోజులు ముందు వర్షం వచ్చే పరిస్థితులు సంక్రమణ మరియు రంగు అభివృద్ధికి అనుకూలంగా ఉంటాయి. పొడవైన పుష్పకాలం మరియు సంకుచిత ఫోటోపీరియడ్ కూడా ఈ వ్యాధికి అనుకూలంగా ఉంటాయి."),
        "cercospora_management_text": MessageLookupByLibrary.simpleMessage(
            "శుభ్రమైన మరియు సర్టిఫైడ్ గింజలను ఉపయోగించండి. JS 80-21 మరియు బ్రాగ్ వంటి తక్కువ ప్రభావితమైన రకాలను సాగు చేయండి. గింజలపై థిరామ్ + కార్బెండాజిమ్ (2:1) లేదా క్యాప్టాన్ @ 0.3% తో చికిత్స చేయండి మరియు ఆపై సంక్రమిత పంటపై బెనోమైల్ @ 0.1% లేదా థియోఫెన్నేట్ మిథైల్ @ 0.05% ను పసపిడి చేయండి."),
        "cercospora_symptoms_text": MessageLookupByLibrary.simpleMessage(
            "1. గింజ మరియు విత్తనాలలో: సంక్రమిత గింజలు గులాబీ నుండి హাল్కా పర్పుల్ మరియు గోధుమ రంగుల వరకు ఉండే చిన్నచిన్న మచ్చల నుండి పెద్ద పెద్ద చొప్పులతో మొత్తం ఉపరితలం మీద కప్పుకుంటాయి. సంక్రమిత గింజల గులికెడు తగ్గుతుంది. గులికెడు సమయంలో, క్షీణించిన మరియు రంగు మారిన కోటిలెడాన్స్‌లు ఉత్పత్తి అవుతాయి, ఇవి త్వరగా పతనమవుతాయి. ఫలితంగా విత్తనాలు కొన్ని రోజులలో చనిపోవచ్చు.\n2. పూర్తి ఎదిగిన మొక్కలపై: ప్యాడ్ స్టేజ్ లేదా తర్వాత, ఆకులపై ఎరుపు-గోధుమ నుండి పర్పుల్ రంగు, కోణాకార మరియు అనియమిత గాయాలు చిన్న చిన్న మచ్చల నుండి పెద్ద అసమమిత ధబ్బలుగా కనిపిస్తాయి. ఇవి సమ్మిళితమై పెద్ద నెక్రోటిక్ ప్రాంతాలను ఏర్పరచవచ్చు. కొన్ని సందర్భాల్లో పైభాగపు ఆకులు పసుపు రంగులో, చర్మంలా మరియు నలుపు రంగులో మారవచ్చు. పెద్ద ప్రాంతాలలో పైభాగపు ఆకుల మురిపోడం ఈ వ్యాధి యొక్క ప్రధాన లక్షణం. అనేక సంక్రమణలు ఆకుల కణాల ఉత్పత్తిలో త్వరగా క్లోరోసిస్ మరియు నెక్రోసిస్‌కు దారితీస్తాయి. పటమైన కణాలు, పై యువ ఆకుల నుంచి ఆకులు నజాయివన కావడం మరియు మొక్క యొక్క సీన్సెన్స్ త్వరగా ఏర్పడడం కూడా సాధారణం."),
        "cercospora_title":
            MessageLookupByLibrary.simpleMessage("సర్కోస్పోరా బ్లైట్"),
        "charcolDescription": MessageLookupByLibrary.simpleMessage(
            "కారణ జీవి: మాక్రోఫోమినా ఫేసోలినా (టాసి) గోయిడ్, ఇది పొడి వేరు కుళ్ళు, ఆషి లేదా తాడు బ్లైట్‌ను కూడా కలిగిస్తుంది. పాథోజెన్ నేల మరియు విత్తనాలతో వ్యాపిస్తుంది. పొడి పరిస్థితులు, తక్కువ నేల ఆర్ద్రత మరియు పోషకాలు మరియు 25°C నుండి 35°C వరకు ఉష్ణోగ్రతలు ఈ వ్యాధికి అనుకూలంగా ఉంటాయి. అనుకూల పరిస్థితుల్లో ఇది 77% దిగుబడి నష్టాలను కలిగించవచ్చు. ఈ వ్యాధి ఎం.పి., రాజస్థాన్, ఢిల్లీ మొదలైన చోట్ల సాధారణంగా కనిపిస్తుంది. ఇది 1997 సీజన్‌లో ఎం.పి.లో గుణా జిల్లాలో జరిగిన ఎపిఫైటోటిక్‌కు కారణమైన పాథోజెన్లలో ఒకటి, ఇది మొక్కల నిల్వ మరియు దిగుబడికి గణనీయమైన నష్టాన్ని కలిగించింది. ఇది వేర్లు, కాండాలు, తొట్టిళ్లు మరియు విత్తనాలను ప్రభావితం చేస్తుంది."),
        "charcolManagement": MessageLookupByLibrary.simpleMessage(
            "పత్తి లేదా ధాన్యాలతో పంటల మార్పిడి లేదా మిశ్రిత పంటలు. ఎరువుల సరైన మోతాదును సమయానికి ఉపయోగించండి. NRC 2, NRC 37, JS 71-05, LSB 1, MACS 13 వంటి తక్కువ సంక్రమించబడే రకాలను ఉపయోగించండి. వ్యాధి తీవ్ర రూపంలో కనిపించే ఫీల్డ్‌లో తక్కువ మొక్కల జనాభాను నిర్వహించండి. విత్తనాలను నాటే ముందు 3-4 వారాల పాటు ముంచడం లేదా పంట వృద్ధి సమయంలో అధిక నేల ఆర్ద్రతను నిర్వహించండి, సాధ్యమైతే. విత్తనాల చికిత్స కోసం కెప్టాన్ లేదా థిరామ్ @ 3 గ్రాములు/కిలో విత్తనాలు లేదా Trichoderma harzianum లేదా T. viride @ 4 నుండి 5 గ్రాములు/కిలో విత్తనాలు ఉపయోగించండి."),
        "charcolSymptoms": MessageLookupByLibrary.simpleMessage(
            "1. విత్తనాలు మరియు మొలకలు: విత్తనాలు నలుపు రంగు వికృతిని పొందుతాయి. ఫంగస్ మొక్క యొక్క వేర్లు మరియు కాండం బేస్‌లను సంక్రమిస్తుంది, మరియు వ్యాధి వేరు కుళ్ళు మరియు ఎండిపోవడం లాగా కనిపిస్తుంది. సంక్రమించిన మొలకలు హైపోకోటైల్ పుట్టే స్థానం వద్ద ఎర్ర-గోధుమ రంగు వికృతిని చూపిస్తాయి. కాండంలో వికృతి నేల స్థాయికి మరియు అంతకు పైగా స్పష్టంగా కనిపిస్తుంది. మొలకలు బలహీనపడి ముందుగానే మరణిస్తాయి. 2. బాగా ఎదిగిన మొక్క: ఎపిడర్మల్ మరియు సబ్-ఎపిడర్మల్ కణజాలాల బూడిద లేదా వెండి రంగు వికృతి మరియు దిగువ కాండం మరియు ఎగువ టాప్ వేరులో అంతర్గత కణజాలాల గోధుమ రంగు వికృతి. ఆకులు పసుపు రంగులో మారతాయి, మరియు మొక్కల ఎండిపోవడం మరియు ఎండిపోవడం స్పష్టంగా ఉంటుంది, మరియు ఫీల్డులో చాలా తక్కువ మొక్కల జనాభా మిగులుతుంది. కాండం పై బాహ్య గాయాలు కూడా తర్వాతి దశలో ఉత్పత్తి అవుతాయి. బాహ్య కర్టికల్ కణజాలాల క్రింద మరియు పిత్ ప్రాంతంలో అధికంగా చిన్న నల్ల స్క్లెరోటియాను ఉత్పత్తి చేస్తుంది, ఇది వెండి నుండి తెలుపు లేదా లైట్ బ్లాక్‌గా మారుతుంది, ఇది వ్యాధి యొక్క నిర్దిష్ట లక్షణం."),
        "charcolTitle": MessageLookupByLibrary.simpleMessage("చార్కోల్ రాట్"),
        "choanephoraLeafBlight":
