        "choanephora_description_text": MessageLookupByLibrary.simpleMessage(
            "కారణకారి అవయవం: చోఎనెఫోరా ఇన్ఫండిబులిఫెరా (క్యూరీ) సాక్. ఈ పాథోజెన్ గాలిలో వ్యాపిస్తుంది. ఇది ఆకులను ప్రభావితం చేస్తుంది. భారత్‌లో, ఇది ఢిల్లీ, మధ్యప్రదేశ్, మరియు రాజస్థాన్‌లో సాధారణం. ఈ వ్యాధి పంటలో 5 నుండి 4% నష్టాలు కలిగించేలా నివేదిక చేయబడింది. ఇది చల్లటి వాతావరణం మరియు అధిక సాపేక్ష ఆర్ద్రతతో కలిసే పరిస్థితుల్లో ప్రోత్సహించబడుతుంది, ఇది సాచురేషన్ పాయింట్‌కు సమీపంగా ఉంటుంది."),
        "choanephora_management_text": MessageLookupByLibrary.simpleMessage(
            "వ్యాధి యొక్క ద్వితీయ వ్యాప్తిని నివారించడానికి సంక్రమిత మొక్కల భాగాలను దహనం చేయండి. ప్రభావిత పంటపై కాపర్ ఆక్సీక్లోరైడ్ @ 0.2% లేదా కార్బెండాజిమ్ (0.05%) ను తాకించండి."),
        "choanephora_symptoms_text": MessageLookupByLibrary.simpleMessage(
            "1. సంపూర్ణ పెరిగిన మొక్కపై: లక్షణాలు వరద తర్వాత 2-3 రోజుల్లో వృద్ధిచెందిన ఆకులపై మరియు అప్పుడప్పుడు మొక్క యొక్క పైభాగంలో ఉన్న యువ ఆకులపై కనిపిస్తాయి. సంక్రమించిన ప్రాంతం గోధుమ రంగులో కనిపిస్తుంది, ఇది కాలిన లేదా రసాయనిక గాయం వలె ఉంటుంది మరియు తరువాత ఇది నలుపు అవుతుంది. గింజలు కూడా సంక్రమించవచ్చు మరియు విస్తృతమైన ఆకుల పతనం కూడా జరుగవచ్చు. దీర్ఘకాలిక అధిక ఆర్ద్రత మరియు చల్లటి వాతావరణం సమయంలో, స్పోరాంజియోఫోర్లు మరియు స్పోరాంజియా సంక్రమిత ఆకులపై ఉదయాన్నే ఎలాంటి సహాయం లేకుండా చూడవచ్చు."),
        "choanephora_title":
