            "ప్రతిఘటక వేరుశెనగ రకాలు మరియు తగిన రసాయన నియంత్రణ అందుబాటులో లేవు. అయితే, క్రింది చర్యలతో వ్యాధిని తక్కువ తీవ్రతతో నిర్వహించి దిగుబడిలో నష్టాన్ని తగ్గించవచ్చు. తక్కువ భావన కలిగిన వేరుశెనగ రకాలు జేఎస్71-05, జేఎస్ 79-81, KHSb 1 మొదలైనవి ఉపయోగించాలి. పంటలను విశాల ఆకుపచ్చ మొక్కల నుండి నిష్క్రమించాలి. వైరస్ సంక్రమించిన మొక్కలను లేదా మొక్కల భాగాలను రోగింగ్ చేసి కాల్చడం తప్పనిసరి. బీజాన్ని ఇమిడాక్లోప్రిడ్తో @5 గ్రాములు/కిలో మరియు నువాక్రాన్ (0.01%) లేదా రోగర్ (0.01%) లేదా ఇతర గమనించదగిన రసాయనాలు శానిటైజ్ చేయాలి."),
        "management_tab": MessageLookupByLibrary.simpleMessage("నిర్వహణ"),
        "management_text": MessageLookupByLibrary.simpleMessage(
            "రోగనిరోధక భూమి, పంట రవాణాలు మరియు కలుపు మొక్కలు ద్వారా నిలుస్తుంది; అందువల్ల, ఖేత్రం శుభ్రత, మల్బి మరియు స్క్లెరోటియాను 15 నుండి 25 స్మీ. లోతుకు పూడ్చడం కోసం గాఢం వేసవి దులిపించడం రోగం తగ్గించడంలో సహాయపడుతుంది. మొక్క, సోర్గుమ్ మొదలైన వాటితో పంట చక్రీకరణ రోగాన్ని కొంత వరకు నియంత్రించడంలో సహాయపడుతుంది. తక్కువ సున్నితమైన రకం NRC 37 ఉపయోగించడం దిగుబడి నష్టాన్ని తగ్గిస్తుంది. రోగగ్రస్త మొక్కలను పీకడం మరియు కాల్చడం ద్వారా రోగం వ్యాప్తి నియంత్రించబడుతుంది. తీరం + కార్బెండాజిమ్ (2:1) @ 3 గ్రా/కిలో లేదా ట్రైకోడెర్మా విరిడే @ 4-5 గ్రా/కిలో బీజ చికిత్స ప్రభావవంతంగా ఉంటుంది. రోగ హాట్‌స్పాట్ ప్రాంతాల్లో నిమ్మకేస్ @ 2.5 టన్ను/హా లేదా క్లోరోనెబ్ @ 20 కిలో/హా మట్టి డ్రెంచ్ ఉపయోగించడం సిఫార్సు చేయబడుతుంది."),
