        "marketPrices": MessageLookupByLibrary.simpleMessage("మార్కెట్ ధరలు"),
        "mosaicDescription": MessageLookupByLibrary.simpleMessage(
            "కారణ జీవి: సోయాబీన్ మోసైక్ వైరస్ వ్యాధి కలుగజేస్తుంది. ఈ వైరస్ పటివైరస్ గుంపుకు చెందినది మరియు ఇది విత్తనాలు, గ్రాఫ్ట్ మరియు రసంతో ప్రసారం చేయబడుతుంది. వ్యాధి విస్తరణం నలుపు ఆహార మొక్కల కంటే చాలా తక్కువగా ఉంటుంది మరియు దాదాపు 32 రకాలకు చెందిన ఏఫిడ్ జాతులచే తాత్కాలికంగా ప్రసారం చేయబడుతుంది. ఇది విత్తనాలు, ఆకులు, కాండం, పెటియోల్స్, పంటలు మరియు విత్తనాలను ప్రభావితం చేస్తుంది. ఇది భారతదేశంలోని సోయాబీన్ పెంపక ప్రాంతాలలో విస్తృతంగా కనిపిస్తుంది. ఈ వ్యాధి 50 నుండి 93% వరకు దిగుబడిని తగ్గిస్తుంది. డిల్లీ నుండి 2-30% నష్టాలను నివేదించబడింది. చల్లటి ఉష్ణోగ్రత (సుమారు 18°C) మరియు తేమ పరిస్థితుల్లో లక్షణాలు తీవ్రమవుతాయి, కానీ 24-25°C వద్ద తక్కువ తీవ్రమవుతాయి మరియు 30°C పైగా లక్షణాలు కనిపించవు."),
        "mosaicManagement": MessageLookupByLibrary.simpleMessage(
