        "mosaicSymptoms": MessageLookupByLibrary.simpleMessage(
            "1. విత్తనాలు మరియు మొక్కలపై: పీడిత విత్తనాలు ఎక్కువసార్లు హిలమ్ అని పిలువబడే రంగుతో విత్తన కవచం కలిగి ఉంటాయి. పీడిత విత్తనాలను విత్తనానికి ఉపయోగించినప్పుడు, వ్యాధి ప్రారంభ లక్షణాలు గాఢ మరియు మేలికలిగిన ఆకుపచ్చ ప్రాంతాల మోసైక్ మరియు ప్రాథమిక ఆకుల దిగువ ముడుచడం, మరియు మొక్కల సన్నని ఆకారం కలిగి ఉంటాయి. అటువంటి మొక్కలలో నిటారుగా కదిలిపోయిన, ముడుచుకున్న, మొటిమలు మరియు మడతపడ్డ ఆకులు ఉంటాయి. తరువాత, త్రిఫోలియట్ ఆకులు పసుపు రంగు, తీవ్రంగా చిన్నవి మరియు ముడుచుకున్నవి అవుతాయి."),
        "myrotheciumLeafSpot":
