            "కారణకర్త సజాతి: Colletotrichum dematium f.sp. truncatum లేదా Colletotrichum truncatum (Schw.) Andrus & W.D. Moore. ఈ జంతువు చాలా వరకు విత్తనాలతో వ్యాప్తి చెందుతుంది. ఇది కాండం, కిరణాలు, ఆకులు మరియు విత్తనాలను ప్రభావితం చేస్తుంది. ఆంత్రాక్నోసు భారతదేశంలోని అన్ని సోయాబీన్ పెంపక ప్రాంతాలలో కనిపిస్తుంది. సాధారణంగా ఇది 16 నుండి 25% నష్టాన్ని కలిగిస్తుంది కానీ కొన్ని సందర్భాల్లో 100% నష్టం కూడా జరుగుతుంది, ముఖ్యంగా ఇది విత్తన దశలో తీవ్రమైన రూపంలో కనిపిస్తే. వేడి వాతావరణం (సుమారు 35°C ఉష్ణోగ్రత) మరియు వర్షం, పొరలు లేదా మేఘాలు, ఇవి 12 గంటలు లేదా ఎక్కువ కాలం పాటు స్వతంత్ర ఆर्द్రతను అందిస్తాయి, ఈ రోగం సంక్రమణను ప్రోత్సహిస్తాయి."),
