            "కారణకారి జీవం: ఈ వ్యాధి రిజోక్టోనియా సోలానీ కుహన్ ద్వారా కలిగిపోతుంది, దీనికి టేలియోమార్ఫ్ థానాటెఫోరస్ క్యూకుమేరిస్. ఈ పాథోజెన్ విత్తన, మట్టీ మరియు గాలి ద్వారా వ్యాపిస్తుంది. ఇది మూలాలు, తక్కువ కాండాలు (అంకురాల నుండి ఉద్భవించేటప్పుడు మరియు పరిపక్వ మొక్కలలో), కాండాలు, ఆకులు, పెటియోల్స్ మరియు పాడ్స్‌ను ప్రభావితం చేస్తుంది. భారతదేశం అంతటా వ్యాప్తి చెందుతుంది కానీ ముఖ్యంగా మధ్యప్రదేశ్ మరియు ఉత్తరాఖండ్ రాష్ట్రాలలో ఎక్కువగా కనిపిస్తుంది. ఇది 35% వరకు ఉత్పత్తి నష్టాన్ని కలిగించవచ్చు, దీని కారణంగా ప్రీ మరియు పోస్ట్-అంకురణ డాంపింగ్ ఆఫ్, రూట్ రాట్, అంకురాల మురుసు మరియు పక్కా మొక్కలలో బ్లైట్ (కలిగే పాడ్స్ మరియు పాడ్‌లో తక్కువ బీజాలు). 24 నుండి 32°C మధ్య ఉష్ణోగ్రత మరియు సానుకూల తేమ మట్టీ పరిస్థితి (30-60 శాతం నీటి పట్టిక సామర్థ్యం) రూట్ రాట్ దశకు అనుకూలంగా ఉంటుంది. సోయాబీన్ మొక్కల సాగులో మోనోకల్చర్ అధికంగా ఉండటం ఈ వ్యాధి తీవ్రతను పెంచుతుంది."),
        "root_management_text": MessageLookupByLibrary.simpleMessage(
