        "rust": MessageLookupByLibrary.simpleMessage("రస్ట్"),
        "rust_description_text": MessageLookupByLibrary.simpleMessage(
            "పచ్చిగా మరియు ఆరోగ్యకరమైన విత్తనాలను ఉపయోగించండి. సోకిన మొక్కల మलबాలను కాల్చడం. బ్రాగ్, హిమ్సో 1563, హార్డీ, PK 472, JS 80-21, పుసా 37, VLS 21, NRC 12 వంటి మధ్యస్థ నిరోధక జాతుల సాగు చేయండి. థిరామ్ + కార్బెండాజిమ్ (2:1) లేదా కాప్టన్ @ 3 గ్రాములు/కిలో విత్తనం మరియు సోకిన పంటపై జినెబ్ లేదా మాంకోజెబ్ 0.2% చిప్పడం."),
        "rust_management_text": MessageLookupByLibrary.simpleMessage(
            "గర్మి సమయంలో లోతుగా తవ్వడం. వేసవి మరియు రబీ సీజన్లలో సోయాబీన్లను పెంచకండి మరియు ఈ సీజన్లలో స్వీయంగా మొలకెత్తిన సోయాబీన్ మొక్కలను తీసివేయడం. సోకిన మొక్కలను తీసివేయడం, పంట మరియు పంట మిగులు కాల్చడం. మాన్సూన్ సీజన్లో ఆ ప్రాంతం యొక్క ఇతర పంటలతో సోయాబీన్లను అంతర్ పంటగా సాగు చేయడం. కట్టును సహించే జాతులు, అంకుర్, PK 1024, PK 1029, JS 80-21, ఇండిరా సోయాబీన్ 9, MAUS 61-2 లేదా త్వరగా పండే జాతుల సాగు చేయడం. హెక్టాక్సోనాజోల్ (కాంటాఫ్) లేదా ప్రోపికొనాజోల్ (టిల్‌ట) లేదా ట్రయడైమెఫన్ (బయల్టన్) లేదా ఆక్సీకార్బోక్సిన్ (ప్లాంటవాక్స్) @ 0.1% రెండు నుండి మూడు స్ప్రేలు దశలను దృష్టిలో ఉంచి విజయవంతంగా పనిచేస్తాయి. సోయాబీన్ పొలంలో స్ప్రే చేయడానికి కనీసం ప్రతి 15 వరసల తరువాత 1.50 మీటర్లు చొప్పున విరుగుడి ఇవ్వాలి. కట్టుకు ఎక్కువ వచ్చే ప్రాంతాలలో 35-40 DASలో ఒక ప్రొటెక్టివ్ స్ప్రే చేయాలి."),
        "rust_symptoms_text": MessageLookupByLibrary.simpleMessage(
