            "ఒక పాన్‌లో నెయ్యి వేసి కరిగించండి. ఇప్పుడు అందులో సుజి-ఒకరా మిశ్రమం (1:1) చేర్చి బంగారు రంగులోకి మారే వరకు వేయించండి. వేయించిన తరువాత, మిశ్రమంలో 4 రెట్లు నీరు వేసి ముద్దగా మారేవరకు కలపండి. వంట చేసేటప్పుడు మంట తక్కువగా ఉంచి చివరలో కాజూ, బాదం మరియు ద్రాక్ష పండ్లు కలపండి."),
        "soyLadooDescription": MessageLookupByLibrary.simpleMessage(
            "సోయా-అట్టా లడ్డూ శీతాకాలంలో తినడానికి ఇష్టపడే ఎనర్జీ-డెన్స్ ఫుడ్ ఉత్పత్తులు. మొదట, ఒక వోక్‌లో నెయ్యి వేసి పరిగెడించండి. తరువాత, పరిగెడించిన నెయ్యిలో సీఫ్ చేసిన గోధుమ మరియు సోయా పిండి 1:1 నిష్పత్తిలో వేసి, నిరంతరం కలపాలి. మధ్య మంటపై పిండి పచ్చగా ఉండే వరకు మరియు మంచి సువాసన వస్తే వరకు రోస్ట్ చేయండి. తరువాత, కాజూ ముక్కలు, చక్కెర మరియు పొడిచిన కొబ్బరికాయను కాస్త వేడి ఉన్న రోస్ట్ చేసిన పిండి లో వేయండి. మీ చేతిలో కొంత మిశ్రమాన్ని తీసుకుని, దాన్ని రౌండ్ ఆకారంలో ముడుచుకోండి. \n\nఇలా చేస్తే మీరు రుచికరమైన సోయా-అట్టా లడ్డూలను తయారు చేసుకోవచ్చు!"),
        "soyMathariDescription": MessageLookupByLibrary.simpleMessage(
            "శుద్ధ గోధుమ పిండి మరియు సోయా పిండి (2:1) తీసుకుని, ఒకటి మీద ఒకటి తెరచి, పిండి లో ఉప్పు, అజ్వాయన, మరియు నెయ్యి వేసి బాగా కలుపాలి. నీటి సహాయంతో కఠినమైన పిండిని ముద్ద చేయాలి. ఇప్పుడు పిండి బంతులు చేసి, వాటిని పూరీలుగా రోల్ చేయాలి. అవి అంతర్గతంగా బాగా పాకమవ్వాలన్నా మరియు పూరీలా ఉబ్బకూడదన్నా, ఒక ఫోర్కుతో ఒక వరుసలో చిన్న రౌండ్ రంధ్రాలు చేయాలి. ఒక ఫ్రయింగ్ పాన్ (కడాయీ) లో నూనె పోసి, వేడి చేయాలి, వేడి నూనెలో మాథ్రీస్ వేసి, తక్కువ మంటపై తరచుగా తిరగబెట్టుతూ గోధుమ రంగు వచ్చే వరకు వేయించాలి, తర్వాత వాటిని తీసుకోవాలి."),
        "soyMilkDescription": MessageLookupByLibrary.simpleMessage(
            "సోయా పాలు సోయాబీన్ల యొక్క వేడి నీటి ఉత్పత్తి. సోయా పాలు పాలు వంటి విధంగా నిర్వహించబడవచ్చు మరియు ఉపయోగించబడవచ్చు. ప్రోటీన్, విటమిన్లు మరియు ఖనిజాలు ఎక్కువగా ఉన్నప్పటికీ, సోయా పాలు లాక్టోస్-రహితము, కొలెస్ట్రాల్-రహితము మరియు కీడు కొవ్వు తక్కువగా ఉంటుంది. 1 లీటర్ సోయా పాలు తయారుచేయడానికి, 125 గ్రాములు సోయాబీన్లు అవసరం. సోయాబీన్లను కడిగి, 10-15 నిమిషాలు ఉడికించండి, నీటిని త్రాగి, 3-4 గంటల పాటు నీటిలో నానబెట్టండి. సోయాబీన్ల నుండి నీటిని త్రాగి, చేతుల మధ్య రుద్దడం ద్వారా తొక్కండి. సోయాబీన్లను మిక్సీలో వేసి, నీరు జోడించి, కొంచెం నీరు జోడించి పేస్ట్ తయారుచేయండి. మిశ్రమానికి 1 లీటర్ వేడి నీటిని పోయి మిక్సర్‌ను మళ్లీ నడపండి. పాలను ఉడికించండి, చెంచాతో కలిపి, ఉడికిన తరువాత మంటను ఆర్పండి. ఇప్పుడు శుభ్రమైన కాటన్‌తో ఉడికించిన పాలను వడగట్టి, సోయా పాలు సిద్ధంగా ఉన్నాయి."),
        "soyNankhataiDescription": MessageLookupByLibrary.simpleMessage(
            "సోయ్ నంకతాయిని గ్యాస్ మీద ఒక బాగా బరువైన వాక్కులో లేదా ప్రెషర్ కుక్కర్లో తయారుచేయవచ్చు. మైదా మరియు సోయా పిండి (2:1) తీసుకొని, కలిపి చూర్ణం చేయాలి. పొడిగా ఉన్న ఎలకులను పొడి చేసుకుని, పిస్తా కాయలను బాగా కట్ చేయాలి. పాలు ఉంచిన వెన్నను కరిగించాలి. మైదా, కాల్చిన సోయా పిండి, బేకింగ్ పౌడర్, ఎలకుల పొడి మరియు చక్కెరను కలిపి మిశ్రమం తయారు చేయాలి. ఇప్పుడు కరిగిన వెన్నను ఈ మిశ్రమంలో వేసి, చేతుల సహాయంతో మృదువైన పిండిని తయారుచేయాలి. బాగా బరువైన, సాదా తలుపు ఉన్న ఒక పాత్ర తీసుకుని, 400 గ్రాముల ఉప్పు లేదా ఇసుకను వేసి, సమంగా చల్లాలి. ఈ పాత్రలో నెట్ స్టాండ్ లేదా వైర్ స్టాండ్ ఉంచాలి. పాత్రను కప్పి, తక్కువ మంటలో వేడి చేయాలి. ఈ సమయంలో, నంకతాయికి చిన్న బంతులను తయారుచేసి, ఒక నూనెలో రాసిన ప్లేట్ మీద ఉంచాలి. నంకతాయిని తక్కువ మంటలో 15-20 నిమిషాల పాటు వండి ఉంచాలి."),
        "soyNutsDescription": MessageLookupByLibrary.simpleMessage(
            "ముందుగా, సోయాబీన్స్ ను శుభ్రం చేయడానికి అన్ని అదనపు పదార్థాలను తీసివేయండి, తర్వాత 10 నిమిషాలు ఉడికించి, ఉడికించిన సోయాబీన్స్ ను 2-3 గంటల పాటు నానబెట్టి, తర్వాత నీటిని తీసేసి 1 గంట పాటు పొద్దును ఆరబెట్టి, తర్వాత వంటతో లేదా వేయించి మసాలాలు, ఉప్పు మరియు ఇతర పదార్థాలతో కలిపి ఉపయోగించండి."),
        "soyPakoraDescription": MessageLookupByLibrary.simpleMessage(
            "ఓకారా మరియు బేసన్ ను సమాన నిష్పత్తిలో కలపండి. ఆకుకూరి, అల్లం-పచ్చి వెల్లుల్లి పేస్ట్, బాగా తరిగిన ఉల్లిపాయ మరియు ధనియాలు వేసి కలపండి. మసాలాలు (హింగు, ఎర్ర మిరియాల పొడి, ధనియాల పొడి, ఉప్పు) వేసి బాగా కలపండి. పకోడా తయారుచేసే బ్యాటర్ సిద్ధం అవుతుంది. కడాయి లో నూనె వేడి చేసి, చేతితో చిన్న పాళ్ళుగా వేసి, పసుపు గోల్డ్ రంగు అయ్యేవరకు వేయించండి. తరువాత నూనెలో నుండి తీసి పెట్టుకోండి."),
        "soyUpmaDescription": MessageLookupByLibrary.simpleMessage(
            "సోయా ఓకారా మరియు రవ్వను 1:1 నిష్పత్తిలో కలపండి మరియు నిరంతరంగా గోళ్లు తిప్పుతూ అది బంగారం రంగులో మారేవరకు వేయించండి. వేయించిన మిశ్రమాన్ని ప్లేట్‌లో విడిగా పెట్టండి. ఇప్పుడు వేరుశనగలను వేయించి అది బంగారం రంగులో మారేవరకు వదిలివేయండి. ఒక వేపు ప్యాన్‌లో నూనె వేడి చేయండి మరియు మస్టర్డ్ బీజాలు వేసి, అవి చీటిక్కేపోతే, ఆకుకూరి, క్యారెట్ మరియు మटर వేసి 2-3 నిమిషాలు వేయించండి. తరువాత వేయించిన ఓకారా-రవ్వ మిశ్రమాన్ని వేసి, మూడు రెట్లు నీళ్లు కలపండి. ఉప్పు చేర్చండి మరియు బ్యాటర్ గట్టిపడిన తర్వాత, వేరుశనగలను వేసి 3-4 నిమిషాలు వేపించండి."),
        "soybeanGuidelines": MessageLookupByLibrary.simpleMessage(
            "ఈ మార్గదర్శకాలు సోయాబీన్ ఉత్పత్తి, కోత, నిల్వ మొదలైన వాటికి వర్తించబడతాయి. రైతులు సురక్షితమైన మరియు ప్రీమియం సోయాబీన్ ఉత్పత్తి చేయడానికి అనుకూలమైన చర్యలను చేపట్టవచ్చు."),
        "soybeanGyan": MessageLookupByLibrary.simpleMessage(
            "సోయాబీన్ జ్ఞాన్ భారతదేశంలో ఉన్న సోయాబీన్ పరిశోధనా సంస్థ, ఇండోర్, రైతులకు అవసరమైన అన్ని వ్యవసాయ సమాచారాన్ని అందించడానికి రూపొందించబడిన మరియు అభివృద్ధి చేయబడిన ఒక అనువర్తనం. ఈ అనువర్తనది రైతులకు వ్యవసాయ ఆధారిత కొత్త ఆవిష్కరణలు మరియు పరిశోధనలను పంచుకోవడానికి ఉద్దేశించబడింది."),
        "soybeanGyan1": MessageLookupByLibrary.simpleMessage("సోయాబీన్ జ్ఞానం"),
        "soybeanManureDescription": MessageLookupByLibrary.simpleMessage(
            "సోయాబీన్ సమతుల ఆహారపదార్థాల సమతుల్యతను కాపాడే పొదుపు పంట."),
        "soybeanMosaic":
