        "soybeanSeedDrillCumPlanter": MessageLookupByLibrary.simpleMessage(
            "సోయాబీన్ సీడ్ డ్రిల్ కమ్ ప్లాంటర్"),
        "soybean_cost": MessageLookupByLibrary.simpleMessage(
            "ప్రస్తుతం యంత్రం ఖరీదు రూ. 67,200/- ఇది అవసరమైతే సమీక్ష చేయబడుతుంది. దీనిలో రవాణా ఖర్చు లెక్కించబడలేదు."),
        "soybean_features": MessageLookupByLibrary.simpleMessage(
            "ఇది విత్తనాలను డ్రిల్ చేయడం మరియు విత్తనాలను తగిన దూరంలో నాటడం వంటి చర్యలను నిర్వహించే ప్రత్యేకమైన యంత్రం."),
